import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be visible
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const prices = await page.$$eval('.product-price', elements =>
      elements.map(el => {
        // Get the text content, trim whitespace, and split by space to handle original prices
        const priceText = el.textContent.trim().split(' ')[0];
        // Remove the dollar sign and convert to a number
        return parseFloat(priceText.replace('$', ''));
      })
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
